[[package]]
name = "apispec"
version = "1.3.3"
description = "A pluggable API specification generator. Currently supports the OpenAPI Specification (f.k.a. the Swagger specification)."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
PyYAML = {version = ">=3.10", optional = true, markers = "extra == \"yaml\""}

[package.extras]
dev = ["PyYAML (>=3.10)", "flake8 (==3.7.7)", "flake8-bugbear (==19.3.0)", "marshmallow (>=2.19.2)", "mock", "prance[osv] (>=0.11)", "pre-commit (==1.15.2)", "pytest", "tox"]
