tests = ["PyYAML (>=3.10)", "marshmallow (>=2.19.2)", "mock", "prance[osv] (>=0.11)", "pytest"]
validation = ["prance[osv] (>=0.11)"]
webframeworks-tests = ["apispec-webframeworks[tests] (>=0.3.0)"]
yaml = ["PyYAML (>=3.10)"]

[[package]]
name = "appnope"
version = "0.1.3"
description = "Disable App Nap on macOS >= 10.9"
